The Wisconsin Bail Out the People Movement is an outgrowth of the Bailout the People Movement (BOPM), a national network that was founded in October 2008 to oppose the trillion-dollar bank bailout and to demand that the people get bailed out instead. BOPM held the first national protest around joblessness calling for a “Real Jobs Program” at the G20 summit in Pittsburgh.
BOPM has taken up the most crucial issues facing workers, students and ordinary people: including –
• jobs; 
• foreclosures and evictions; 
• education and student rights; 
• immigrant and worker’s rights; 
• stopping racism and hate groups like the Tea Party; 
• opposing the ongoing wars that are bleeding the economy dry; 
• fighting to stop billions of dollars being given to the bank for ‘debt service’,: 
• advocating for health care for all; 
• demanding reproductive freedom and justice for women and rights for LGBTQ people and much, much more.
We are fighting for a national Public Works Jobs Program much like the Works Progress Administration (WPA) enacted during the Great Depression; for a moratorium on home foreclosures; to stop evictions and utility shut-offs; to have the Employee Free Choice Act implemented; and to have full rights for immigrant workers among other struggles.
